import React from 'react';
import { Link, withRouter} from 'react-router-dom';
const Navbar = (props) => {
    return(
        <nav>
            <div className="nav-links">
                <Link style={{textDecoration:'none'}} to='/'>
                    <div>Dashboard</div>
                </Link>
                <Link to='/about'>
                    <p>Calendar View</p>
                </Link>
                <Link to='/projects'>
                    <div>Edit Budget</div>
                </Link>
            </div>
        </nav>
    );
}

export default withRouter(Navbar);
